<H1><A NAME="c2049"></A><SUP></SUP>Compiler Error C2049</H1>

<P class=dt><B>case value 'value' already used</B></P>

<P>The <B>case</B> value was already used in this <B>switch</B> statement.</P>

<P>This error can be caused by enumerations or macros that evaluate to the same value.</P>
